import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  color: red;
  margin: 0;
`;

const Header = styled.nav`
  width: 100%;
  background-color: #0c0a26;
  height: 100px;
  display: flex;
  align-items: center;
`;

export default function Index() {
  return (
    <>
      <Header>
        <Title>Rotzz.gg</Title>
      </Header>
    </>
  );
}
